import React from 'react';

const num =  Math.round(Math.random()*5);

const mesArr = [
	'Welcome beck...',
	'Hi there...',
	'This is it...',
	'Look at all this...',
	'Hey...'
]


const message = () => {
	if (num < 3) {
		return 'Hello, ' + num + ' is less than 3...';
	} else if (num === 3) {
		return 'Hello, ' + num + ' is equal to 3 (duh)...';
	} else {
		return 'Hello, ' + num + ' is greater than 3...';
	}
}

const Banner = (props) => {
	return (
		<div>
			<p>{
				message()
			}</p>
			<div id='banner' title='"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'></div>
		</div>
	);
}

export default Banner;
